import React from 'react';
import '../assets/css/home.css';

function Home() {
  return (
    <div className="home-container">
      <img src={`${process.env.PUBLIC_URL}/assets/images/logo.png`} alt="Travel Tribe Logo" />
      <div className="hero">
        <video src={`${process.env.PUBLIC_URL}/assets/videos/bgvid.mp4`} autoPlay loop muted />
        <h1>Welcome to Travel Tribe</h1>
      </div>
    </div>
  );
}

export default Home;
